import React from "react"
import { Navigation } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
import { Image } from "react-bootstrap";

import 'swiper/scss';
import 'swiper/scss/navigation';

const PickCarousel = () => {
  return (
    <Swiper
      spaceBetween={20}
      slidesPerView={4}
      slidesPerGroup={4}
      modules={[Navigation]}
      grabCursor={true}
      navigation
    >
      <SwiperSlide>
        <Image src={"/image/Product/Pick_1_1_800x.jpg"} alt="Pick_1_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_2_1_800x.jpg"} alt="Pick_2_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_3_1_800x.jpg"} alt="Pick_3_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_4_1_800x.jpg"} alt="Pick_4_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_5_1_800x.jpg"} alt="Pick_5_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_6_1_800x.jpg"} alt="Pick_6_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_7_1_800x.jpg"} alt="Pick_7_1_800x" fluid />
      </SwiperSlide>
      <SwiperSlide>
        <Image src={"/image/Product/Pick_8_1_800x.jpg"} alt="Pick_8_1_800x" fluid />
      </SwiperSlide>
    </Swiper>
  )
}

export default PickCarousel
